Parser::Parser() {}

// 实现shift操作
void Parser::shift(std::stack<int> &stateStack, std::stack<Token> &symbolStack, int newState, const Token &token)
{
    stateStack.push(newState);
    symbolStack.push(token);
    // printStateStack(stateStack); // 打印状态栈内容
    printSymbolStack(symbolStack); // 打印符号栈
    std::cout << "[Shift] Shift: Pushed state " << newState << " and token " << token.getValue() << " to the stack." << std::endl;
}

void Parser::reduce(std::stack<int> &stateStack, std::stack<Token> &symbolStack, int productionNumber)
{
    const Production &production = productions[productionNumber];

    // 根据产生式右部长度进行pop操作
    for (int i = 0; i < production.rightLength; ++i)
    {
        stateStack.pop();
        symbolStack.pop();
    }

    // 栈不为空时，获取当前状态
    if (stateStack.empty())
    {
        std::cerr << "Error: State stack is empty after pop operations." << std::endl;
        exit(EXIT_FAILURE); // 终止程序执行
    }

    // 获取当前状态
    int currentState = stateStack.top();
    NonTerminal nonTerminal = production.left; // 产生式左部

    // 推入新的状态
    if (gotoTable[currentState].find(nonTerminal) == gotoTable[currentState].end())
    {
        std::cerr << "Error: No transition for non-terminal " << getNonTerminalName(nonTerminal) << " from state " << currentState << std::endl;
        exit(EXIT_FAILURE); // 终止程序执行
    }

    int newState = gotoTable[currentState][nonTerminal];
    stateStack.push(newState);

    if (symbolStack.empty())
    {
        size_t curLine = 1; // 暂时设置为 1
        symbolStack.push(Token(nonTerminal, this->getNonTerminalName(nonTerminal),curLine));
    }
    else
    {
        // 将产生式左部非终结符推入符号栈
        size_t curLine = symbolStack.top().getLineNum();
        symbolStack.push(Token(nonTerminal, this->getNonTerminalName(nonTerminal),curLine));
    }
    // 打印状态栈内容
    // printStateStack(stateStack);
    // 打印符号栈
    printSymbolStack(symbolStack);

    std::cout << "[Reduce] Reducing using production: " << productionNumber << " (" << getNonTerminalName(production.left) << " -> " << production.rightLength << " symbols)" << std::endl;
}


// 判断字符串是否为数字
bool Parser::isNumber(const std::string &str)
{
    for (char const &c: str)
    {
        if (std::isdigit(c) == 0) return false;
    }
    return true;
}

// 打印符号栈内容
void Parser::printSymbolStack(const std::stack<Token> &symbolStack)
{
    std::stack<Token> tempStack = symbolStack;
    std::vector<Token> symbols;

    while (!tempStack.empty())
    {
        symbols.push_back(tempStack.top());
        tempStack.pop();
    }

    std::cout << "\nSymbol Stack: ";
    for (auto it = symbols.rbegin(); it != symbols.rend(); ++it)
    {
        std::cout << it->getValue() << " ";
    }
    std::cout << std::endl;
}

// 打印状态栈内容
void Parser::printStateStack(const std::stack<int> &stateStack)
{
    std::stack<int> tempStack = stateStack;
    std::vector<int> states;

    while (!tempStack.empty())
    {
        states.push_back(tempStack.top());
        tempStack.pop();
    }

    std::cout << "\n\nState Stack: ";
    for (auto it = states.rbegin(); it != states.rend(); ++it)
    {
        std::cout << *it << " ";
    }
    std::cout << std::endl;
}

// 实现语法分析函数
bool Parser::parse(const std::vector<Token> &tokens)
{
    std::stack<int> stateStack;
    std::stack<Token> symbolStack;
    std::string error_output;
    stateStack.push(0);

    size_t index = 0;
    bool has_error = false; // 是否存在语法错误
    bool err_flag = false; // 当前是否处于错误处理过程
    while (index < tokens.size())
    {
        if (stateStack.empty())
        {
            std::cerr << "Error: State stack is empty." << std::endl;
            std::cerr << error_output << std::endl;
            return false; // 语法分析失败
        }
        int currentState;
        Token currentToken;
        TokenType tokenType;
        if(!err_flag) // 当前不是错误处理过程
        {
            currentState = stateStack.top();
            currentToken = tokens[index];
            tokenType = currentToken.getType();
        }
        else // 当前处于错误处理过程
        {
            currentState = stateStack.top();
            currentToken = symbolStack.top(); // 取出错误处理时指定情况下加入的辅助Token
            symbolStack.pop(); // 弹出错误处理时指定情况下加入的辅助Token，以便程序能够按照流程继续分析
            tokenType = currentToken.getType();
        }
        if (parseTable[currentState].find(tokenType) == parseTable[currentState].end()) // 未能识别的Token类型，不能分析，直接报错
        {
            std::cerr << "[Line: " << currentToken.getLineNum() << "] Syntax Error!  Token: " << currentToken.getValue() << std::endl;
            std::cerr << error_output << std::endl;
            return false; // 存在语法错误
        }

        std::string action = parseTable[currentState][tokenType];
        if(action == "r102s57") // "=" 移入/归约 冲突处理
        {
            Token nextToken = tokens[index+1];
            if(nextToken.getType()==TokenType::KEYWORD_FUNCTION) // 函数定义
            {
                int newState = 57;
                shift(stateStack, symbolStack, newState, currentToken);
                if(!err_flag)
                    ++index;
                else
                    err_flag = false; // 上一个Token存在语法错误时，index不能+1，处理完错误应当继续分析当前Token
            }
            else
            {
                int productionNumber = 102;
                reduce(stateStack, symbolStack, productionNumber);
            }
        }
        else if (action[0] == 's')
        {
            int newState = std::stoi(action.substr(1));
            shift(stateStack, symbolStack, newState, currentToken);
            if(!err_flag)
                ++index;
            else
                err_flag = false; // 上一个Token存在语法错误时，index不能+1，处理完错误应当继续分析当前Token
        }
        else if (action[0] == 'r')
        {
            int productionNumber = std::stoi(action.substr(1));
            reduce(stateStack, symbolStack, productionNumber);
        }
        else if (action == "acc")
        {
            if(!has_error)
            {
                std::cout << "\nParsing succeeded!" << std::endl;
                return true;
            }
            else
            {
                std::cerr << "\n\nError summary: " << std::endl;
                std::cerr << error_output << std::endl;
                std::cout << "\nParsing terminated!" << std::endl;
                return false;
            }
        }
        else if (action == "") // 错误处理
        {
            has_error = true;
            if(!error(currentState, currentToken, symbolStack, error_output))
            {
                std::cerr << "\n\nError summary: " << std::endl;
                std::cerr << error_output << std::endl;
                std::cout << "\nParsing terminated!" << std::endl;
                return false; // 存在语法错误，且需要终止分析
            }
            err_flag = true;
        }
    }
    return true;
}

// 获取非终结符名称
