{
    switch (nonTerminal)
    {
        case NonTerminal::S: return "S";
        case NonTerminal::PROGRAM: return "PROGRAM";
        case NonTerminal::DECLARATIONS: return "DECLARATIONS";
        case NonTerminal::DECLARATION: return "DECLARATION";
        case NonTerminal::STATEMENT: return "STATEMENT";
        case NonTerminal::BREAKSTMT: return "BREAKSTMT";
        case NonTerminal::CONTINUESTMT: return "CONTINUESTMT";
        case NonTerminal::RETURNSTMT: return "RETURNSTMT";
        case NonTerminal::FUNDECL: return "FUNDECL";
        case NonTerminal::VARDECL: return "VARDECL";
        case NonTerminal::VARDEF: return "VARDEF";
        case NonTerminal::VARDEFS: return "VARDEFS";
        case NonTerminal::VARINIT: return "VARINIT";
        case NonTerminal::TYPE: return "TYPE";
        case NonTerminal::EXPRSTMT: return "EXPRSTMT";
        case NonTerminal::IFSTMT: return "IFSTMT";
        case NonTerminal::ELSEBRANCH: return "ELSEBRANCH";
        case NonTerminal::WHILESTMT: return "WHILESTMT";
        case NonTerminal::BLOCK: return "BLOCK";
        case NonTerminal::REPEATSTMT: return "REPEATSTMT";
        case NonTerminal::PARAMLIST: return "PARAMLIST";
        case NonTerminal::PARAMETERS: return "PARAMETERS";
        case NonTerminal::PARAMETER: return "PARAMETER";
        case NonTerminal::EXPRESSION: return "EXPRESSION";
        case NonTerminal::ASSIGNMENT: return "ASSIGNMENT";
        case NonTerminal::LOGIC_OR: return "LOGIC_OR";
        case NonTerminal::LOGIC_OR_PRIME: return "LOGIC_OR_PRIME";
        case NonTerminal::LOGIC_AND: return "LOGIC_AND";
        case NonTerminal::LOGIC_AND_PRIME: return "LOGIC_AND_PRIME";
        case NonTerminal::EQUALITY: return "EQUALITY";
        case NonTerminal::EQUALITY_PRIME: return "EQUALITY_PRIME";
        case NonTerminal::COMPARISON: return "COMPARISON";
        case NonTerminal::COMPARISON_PRIME: return "COMPARISON_PRIME";
        case NonTerminal::TERM: return "TERM";
        case NonTerminal::TERM_PRIME: return "TERM_PRIME";
        case NonTerminal::FACTOR: return "FACTOR";
        case NonTerminal::FACTOR_PRIME: return "FACTOR_PRIME";
        case NonTerminal::INCR_EXP: return "INCR_EXP";
        case NonTerminal::INCR_OP: return "INCR_OP";
        case NonTerminal::UNARY: return "UNARY";
        case NonTerminal::CALL: return "CALL";
        case NonTerminal::CALL_SUFFIX: return "CALL_SUFFIX";
        case NonTerminal::ARGLIST: return "ARGLIST";
        case NonTerminal::ARGUMENTS: return "ARGUMENTS";
        case NonTerminal::PRIMARY: return "PRIMARY";
        case NonTerminal::CONST: return "CONST";
        case NonTerminal::VAR: return "VAR";
        case NonTerminal::VARSUFFIX: return "VARSUFFIX";
        case NonTerminal::FORSTMT: return"FORSTMT";

        default: return "UNKNOWN";
    }
}
